import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the "Your Profile" link to render the profile section
    await page.getByText('Your Profile', { exact: true }).first().click();

    // Wait for the profile section to become visible
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.username').textContent();
    const bio = await page.locator('.bio').textContent();
    const totalOrders = await page.locator('.stat').filter({ hasText: 'Orders' }).locator('.stat-number').textContent();
    const totalReviews = await page.locator('.stat').filter({ hasText: 'Reviews' }).locator('.stat-number').textContent();
    const sellerRating = await page.locator('.stat').filter({ hasText: 'Seller Rating' }).locator('.stat-number').textContent();

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      totalOrders: parseInt(totalOrders.trim(), 10),
      totalReviews: parseInt(totalReviews.trim(), 10),
      sellerRating: parseFloat(sellerRating.trim())
    };

    return {
      success: true,
      action: "Harvested user profile information from the profile page.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
